                    <h2>Locations</h2>

                    <h3>Nelson</h3>
                    <p>123 Nelson Street</p>

                    <h3>Tahunanui</h3>
                    <p>123 Tahunanui Street</p>

                    <h3>Richmond</h3>
                    <p>123 Richmond Street</p>
                </div>
            </div>
        )
    }
}

class Contact extends React.Component {
    render() {
        return (
            <div>
                <img alt='Nothing Yet' />
